import React from "react";
import { Menu, Button, Dropdown } from "antd";

function Control() {
  const menu = (
    <Menu>
      <MenuItem>
        <a
          target="_blank"
          rel="noopener noreferrer"
          href="http://www.alipay.com/"
        >
          1st menu item
        </a>
      </MenuItem>
    </Menu>
  );

  return (
    <Dropdown overlay={menu} placement="bottomCenter">
      <Button>bottomCenter</Button>
    </Dropdown>
  );
}

export default Control;
